    <style>

        .font-size-20 {

        }

        .margin-top-15p {
            margin-top: 15%

        .center {
            text-align: center;
        }

        .background-orange {
            background: orange;
        }

        .input {
            font-size: 20px;
            width: 19px;
            height: 19px;
            text-align: center;
            margin: 2px 1px 2px 1px;
        }

        .add {
            font-size: 15px;
            width: 25px;
            height: 25px;
            margin-left: 3px;
        }

        .qr {
            width: 40px;
            height: 40px;
            margin: 5px 5px 5px 5px;
        }

        .gray {
            background-color: gray
        }

        .white {
            background-color: white
        }

        .yellow {
            background-color: yellow
        }

        .box40 {
            width: 40px;
            height: 40px;
        }

        footer {
            position: fixed;
            bottom: 1em;
            left: 50%;
            transform: translateX(-50%);
            width: auto;
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 0.5em;
            padding: 0 1em;
            z-index: 10;
        }

        @media screen and (max-width: 768px) {

            html {
                font-size: 14px;
            }

            body {
                zoom: 100% !important;
                padding: 1rem;
            }

            .margin-top-15p {
                margin-top: 5%;
            }

            .qr {
                width: 40px;
                height: 40px;
            }

            div:has(br) {
                height: 0.5em; /* Smaller space on mobile */
            }

            div:has(br):nth-child(2), #main > div:has(br):nth-child(3) {
                display: none;
            }

        }


        @media screen and (max-width: 200px) {

            footer {
                display: none
            }

            #main {
                display: none
            }

        }

        @media screen and (max-height: 200px) {

            footer {
                display: none
            }

            #main {
                display: none
            }

        }

    </style>
